import "./Table.css";
import { parseLabel } from "./../../utils/AppUtils";
import { useState, useEffect } from "react";
import { TableComp } from "antd";
import axios from "axios";

const Table = () => {
  const [branches, setBranches] = useState([]);
  useEffect(() => {
    axios.get("/api/branches").then(({ data }) => setBranches(data));
  }, []);

  console.log(branches);

  function getColumns() {
    let columns = [];
    if (branches.length) {
      Object.keys(branches[0]).forEach((key) => {
        columns.push({
          title: parseLabel(key),
          dataIndex: key,
          key: key,
        });
      });
    }
    return columns;
  }

  return (
    <TableComp columns={getColumns()} dataSource={branches} className="table" />
  );
};

export default Table;
